import { createTheme } from '@mui/material/styles'

export const theme = createTheme({
  direction: 'rtl',
  palette: {
    mode: 'dark',
    primary: {
      main: ''
    },
    secondary: {
      main: ''
    }
  },
  typography: {
    fontFamily: 'vazir, roboto'
  }
})
